import '../css/home.css' ;
import Navbar from '../component/navbar';
import { Fragment } from 'react';
import BoxVdo1 from '../component/ContentBoxVdo1';
import ContenBox1 from '../component/ContentBox1';
import Scolltotop from '../component/ScollToTop';
import Footers from '../component/footer';
function home() {

    return (

        <div>
            <body>
            <Navbar></Navbar>

            <section class="landingpage">

                <ContenBox1></ContenBox1>


                <section class="vdo" >
                    <BoxVdo1></BoxVdo1>
                </section>

                <Fragment>
                    <Scolltotop></Scolltotop>
                </Fragment>

            </section>


            <section>
                <Footers></Footers>
            </section>




        </body>
        </div>
    );
  }

  export default home;
